import React from 'react';
import { Link, NavLink } from 'react-router-dom';

const Header = () => {
    return (
        <header>
            <h1>
                <Link to="/">Kişisel Gider Takip Uygulaması</Link>
            </h1>
            <nav>
                <ul>
                    <li><NavLink to="/">Anasayfa</NavLink></li>
                    <li><NavLink to="/income">Gelir</NavLink></li>
                    <li><NavLink to="/expenses">Gider</NavLink></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
